uint8 _decimals; // STORAGE[0x3] bytes 0 to 0

// Events
Transfer(address, address, uint256);
Burn(address, uint256);
FrozenFunds(address, bool);

function name() public nonPayable { 
    v0 = new bytes[](_name.length);
    v1 = v2 = v0.data;
    if (_name.length) {
        if (31 < _name.length) {
            do {
                MEM[v1] = STORAGE[v3];
                v3 += 1;
                v1 += 32;
            } while (v2 + _name.length <= v1);
        } else {
            MEM[v2] = _name.length >> 8 << 8;
        }
    }
    v4 = new array[](v0.length);
    v5 = v6 = 0;
    while (v5 < v0.length) {
        MEM[v4.data + v5] = MEM[v0.data + v5];
        v5 = v5 + 32;
    }
    v7 = v8 = v0.length + v4.data;
    if (0x1f & v0.length) {
        MEM[v8 - (0x1f & v0.length)] = ~(256 ** (32 - (0x1f & v0.length)) - 1) & MEM[v8 - (0x1f & v0.length)];
    }
    return v4;
}

function approve(address varg0, uint256 varg1) public nonPayable { 
    _allowance[varg0] = varg1;
    return 1;
}

function totalSupply() public nonPayable { 
    return _totalSupply;
}

function transferFrom(address varg0, address varg1, uint256 varg2) public nonPayable { 
    require(varg2 <= _allowance[msg.sender]);
    _allowance[msg.sender] = _allowance[msg.sender] - varg2;
    0x80b(varg2, varg1, varg0);
    return 1;
}

function decimals() public nonPayable { 
    return _decimals;
}

function burn(uint256 varg0) public nonPayable { 
    require(_balanceOf[msg.sender] >= varg0);
    _balanceOf[msg.sender] = _balanceOf[msg.sender] - varg0;
    _totalSupply = _totalSupply - varg0;
    emit Burn(msg.sender, varg0);
    return 1;
}

function selfdestructs() public payable { 
    selfdestruct(_selfdestructs);
}

function balanceOfa(address varg0) public nonPayable { 
    return _balanceOf[varg0];
}

function balanceOf(address varg0) public nonPayable { 
    return _balanceOf[varg0];
}

function mintToken(address varg0, uint256 varg1) public nonPayable { 
    require(msg.sender == _selfdestructs);
    _balanceOf[varg0] = _balanceOf[varg0] + varg1;
    _totalSupply = _totalSupply + varg1;
    emit Transfer(0, address(this), varg1);
    emit Transfer(address(this), varg0, varg1);
}

function burnFrom(address varg0, uint256 varg1) public nonPayable { 
    require(_balanceOf[varg0] >= varg1);
    require(varg1 <= _allowance[msg.sender]);
    _balanceOf[varg0] = _balanceOf[varg0] - varg1;
    _allowance[msg.sender] = _allowance[msg.sender] - varg1;
    _totalSupply = _totalSupply - varg1;
    emit Burn(varg0, varg1);
    return 1;
}

function buyPrice() public nonPayable { 
    return _buy;
}

function owner() public nonPayable { 
    return _selfdestructs;
}

function getEth(uint256 varg0) public payable { 
    v0 = _selfdestructs.call().value(varg0).gas(!varg0 * 2300);
