function setPrices(uint256 varg0) public nonPayable { 
    require(msg.sender == _selfdestructs);
    _buy = varg0;
}

function buy() public payable { 
    assert(_buy);
    0x80b(msg.value / _buy, msg.sender, this);
}

function transfer(address varg0, uint256 varg1) public nonPayable { 
    0x80b(varg1, varg0, msg.sender);
}

function frozenAccount(address varg0) public nonPayable { 
    return 0xff & _frozenAccount[varg0];
}

function approveAndCall(address varg0, uint256 varg1, bytes varg2) public nonPayable { 
    v0 = new bytes[]((?).length);
    CALLDATACOPY(v0.data, 36 + varg2, (?).length);
    v1 = v2 = 0;
    _allowance[varg0] = varg1;
    if (1) {
        v3 = new array[](v0.length);
        v4 = v5 = 0;
        while (v4 < v0.length) {
            MEM[v3.data + v4] = MEM[v0.data + v4];
            v4 = v4 + 32;
        }
        v6 = v7 = v0.length + v3.data;
        if (0x1f & v0.length) {
            MEM[v7 - (0x1f & v0.length)] = ~(256 ** (32 - (0x1f & v0.length)) - 1) & MEM[v7 - (0x1f & v0.length)];
        }
        require(varg0.code.size);
        v8 = varg0.receiveApproval(msg.sender, varg1, address(this), v3).gas(msg.gas - 710);
        require(v8);
        v1 = v9 = 1;
    }
    return v1;
}

function allowance(address varg0, address varg1) public nonPayable { 
    return _allowance[varg1];
}

function freezeAccount(address varg0, bool varg1) public nonPayable { 
    require(msg.sender == _selfdestructs);
    _frozenAccount[varg0] = varg1 | ~0xff & _frozenAccount[varg0];
    emit FrozenFunds(varg0, varg1);
}

function transferOwnership(address varg0) public nonPayable { 
    require(msg.sender == _selfdestructs);
    _selfdestructs = varg0;
}

function 0x80b(uint256 varg0, uint256 varg1, uint256 varg2) private { 
    require(address(varg1) != 0);
    v0 = address(varg2);
    require(_balanceOf[v0] >= varg0);
    v1 = address(varg1);
    v2 = address(varg1);
    require(_balanceOf[v2] + varg0 > _balanceOf[v1]);
    v3 = address(varg2);
    require(!(0xff & _frozenAccount[v3]));
    v4 = address(varg1);
    require(!(0xff & _frozenAccount[v4]));
    v5 = address(varg2);
    _balanceOf[v5] = _balanceOf[v5] - varg0;
    v6 = address(varg1);
    _balanceOf[v6] = _balanceOf[v6] + varg0;
    emit Transfer(address(varg2), address(varg1), varg0);
    return ;
}

